How to insert document with empty key using Mongo C driver?<p>I have this program in C (a slight variation of the <a href="http://mongoc.org/libmongoc/1.17.3/tutorial.html" rel="nofollow noreferrer">hello world example at Mongo C driver documentation</a>:</p>
<pre><code>#include &lt;bson/bson.h&gt;
#include &lt;mongoc/mongoc.h&gt;
#include &lt;stdio.h&gt;

// file insert.c
// compiled with: gcc -o insert insert.c $(pkg-config --libs --cflags libmongoc-1.0)

int main (int   argc, char *argv[])
{
    mongoc_client_t *client;
    mongoc_collection_t *collection;
    bson_error_t error;
    bson_oid_t oid;
    bson_t *doc;

    mongoc_init ();

    client = mongoc_client_new (&quot;mongodb://localhost:27017/?appname=insert-example&quot;);
    collection = mongoc_client_get_collection (client, &quot;mydb&quot;, &quot;mycoll&quot;);

    doc = bson_new ();
    bson_oid_init (&amp;oid, NULL);
    BSON_APPEND_OID (doc, &quot;_id&quot;, &amp;oid);
    BSON_APPEND_UTF8 (doc, &quot;&quot;, &quot;my_key_is_empty&quot;);

    if (!mongoc_collection_insert_one (
        collection, doc, NULL, NULL, &amp;error)) {
    fprintf (stderr, &quot;%s\n&quot;, error.message);
    }

    bson_destroy (doc);
    mongoc_collection_destroy (collection);
    mongoc_client_destroy (client);
    mongoc_cleanup ();

    return 0;
}
</code></pre>
<p>The important statement is this one, to set an empty BSON key (which is a bit weird but legal):</p>
<pre><code>BSON_APPEND_UTF8 (doc, &quot;&quot;, &quot;my_key_is_empty&quot;);
</code></pre>
<p>If I run the program I get this error:</p>
<pre><code>invalid document for insert: empty key
</code></pre>
<p>It's a bit surprising because if I try to do the same with the Mongo shell, it works fine:</p>
<pre><code>&gt; db.mycoll.insert({&quot;&quot;: &quot;my_key_is_empty&quot;})
WriteResult({ &quot;nInserted&quot; : 1 })
&gt; db.mycoll.find()
{ &quot;_id&quot; : ObjectId(&quot;60182cb49fb197394497431e&quot;), &quot;&quot; : &quot;my_key_is_empty&quot; }
</code></pre>
<p>So:</p>
<ol>
<li>This is a limitation in the C driver, or</li>
<li>I'm doing something wrong :)</li>
</ol>
<p>Could you help me with this, please? Thanks!</p>
<p>Some additional info about my system:</p>
<ul>
<li>gcc version: 6.3.0</li>
<li>Mongo C driver version: 1.16.0</li>
<li>MongoDB version: 4.4.1</li>
<li>Operating system: Debian 9.3</li>
</ul>

